import React from 'react';
import { PropTypes } from 'prop-types';
import './Card.css'

function Card(props) {
    return (
        <div className="card">
           <h1>{props.number}</h1>
        </div>
    )
}

Card.propTypes  = {
    number: PropTypes.number
}

export default Card;
